import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Home  from './Pages/Home';



function App() {
  return (
    <React.fragment>
    <Router>
      <Switch>
        <Route exact path = "/" component = { Home }/>

      </Switch>  
    </Router> 


    </React.fragment>
  );
}

export default App;
